(11, '<span style="FONT-SIZE" 12px; FONT-FAMILY: "sans serif", tahoma, verdana, helvetica; WHITE-SPACE: normal; WORD-SPACING: 0px; TEXT-TRANSFORM: none; FLOAT: none; FONT-WEIGHT: 400; COLOR: rgb(0,0,0); FONT-STYLE: normal; ORPHANS: 2; WIDOWS: 2; DISPLAY: inline !important; LETTER-SPACING: normal; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; -webkit-text-stroke-width: 0px; font-variant-ligatures: normal; font-variant-caps: normal; text-decoration-style: initial; text-decoration-color: initial''>一元夺宝作为一个平台，保证所有参与夺宝的用户行为，都享受同样的权利与义务。</span>', '公告一', 'notice', 1, 1, 1551034733),
(12, '<span style="FONT-SIZE" 12px; FONT-FAMILY: "sans serif", tahoma, verdana, helvetica; WHITE-SPACE: normal; WORD-SPACING: 0px; TEXT-TRANSFORM: none; FLOAT: none; FONT-WEIGHT: 400; COLOR: rgb(0,0,0); FONT-STYLE: normal; ORPHANS: 2; WIDOWS: 2; DISPLAY: inline !important; LETTER-SPACING: normal; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; -webkit-text-stroke-width: 0px; font-variant-ligatures: normal; font-variant-caps: normal; text-decoration-style: initial; text-decoration-color: initial''>欢迎访问一元夺宝平台，申请使用一元夺宝平台服务（以下简称“一元夺宝”，“一元夺宝”指用户花费1元兑换一个夺宝币，用户可凭夺宝币使用一元夺宝的服务），请您（下列简称为“用户”）仔细阅读以下全部内容（特别是粗体下划线标注的内容）。如用户不同意本服务条款任意内容，请勿注册或使用一元夺宝。</span>', '服务协议', 'agreement', 3, 1, 1551034759);
INSERT INTO `fanwe_article` (`id`, `title`, `content`, `cate_id`, `create_time`, `sort`, `seo_title`, `seo_keyword`, `seo_description`, `is_effect`, `click_count`) VALUES
(52, '了解一元夺宝', '<div>一元夺宝”指用户花费1元兑换一个夺宝币，用户可凭夺宝币使用一元夺宝的服务。</div>\n<div><br />\n</div>\n<div>每件商品的全部夺宝号码分配完毕后，一元夺宝根据夺宝规则计算出的一个号码。持有该幸运号码的用户可直接获得该商品。</div>\n<div><br />\n</div>\n', 26, 1464120343, 1, '', '', '', 1, 0),
(53, '一元夺宝平台服务协议', '欢迎访问方维一元夺宝平台，申请使用方维公司提供的一元夺宝平台服务（以下简称“一元夺宝”，“一元夺宝”指用户花费1元兑换一个夺宝币，用户可凭夺宝币使用一元夺宝的服务），请您（下列简称为“用户”）仔细阅读以下全部内容（特别是粗体下划线标注的内容）。如用户不同意本服务条款任意内容，请勿注册或使用一元夺宝。', 26, 1464120364, 1, '', '', '', 1, 0),
(54, '常见问题', '<p><span style="line-height:1.5;">1、充值获得夺宝币，然后选择喜欢的商品开始夺宝；</span></p>\n<p><span style="line-height:1.5;"><br />\n</span></p>\n<div>2、点击一个感兴趣的商品，选择要参与的人次并支付，直接充值并参与夺宝。</div>\n<div><br />\n</div>\n<div>1元夺宝，就是这么简单！</div>\n<div>2、1元夺宝是怎么计算幸运号码的？</div>\n<div>1）商品的最后一个号码分配完毕后，将公示该分配时间点前本站全部商品的最后50个参与时间；</div>\n<div>2）将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</div>\n<div>3）为保证公平公正公开，系统还会等待一小段时间，取最近下一期中国福利彩票“老时时彩”的开奖结果（一个五位数值B）；</div>\n<div>4）（数值A+数值B）除以该商品总需人次得到的余数 + 原始数 10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该商品。</div>\n<div>注：如遇福彩中心通讯故障，无法获取上述期数的中国福利彩票“老时时彩”开奖结果，且24小时内该期“老时时彩”开奖结果仍未公布，则默认“老时时彩”开奖结果为111111。</div>\n<div>了解更多“老时时彩”信息</div>\n<div><br />\n</div>\n<div>3、为什么要加入“老时时彩”开奖结果？</div>\n<div>引入“老时时彩”开奖结果是为了保证幸运号码计算结果的绝对公平公正。</div>\n<div><br />\n</div>\n<div>4、幸运号码的计算结果可信吗？</div>\n<div>由于使用了“老时时彩”开奖结果作为参数，因此幸运号码肯定是未知的；</div>\n<div>您可以绝对相信计算结果真实、可信。</div>\n<div><br />\n</div>\n<div>5、怎样查看是否中奖？</div>\n<div>个人中心有您的夺宝记录，点击对应的记录，即可知道该期夺宝的获得者</div>\n', 26, 1464120384, 1, '', '', '', 1, 0),
(55, '公平保障', '一元夺宝作为一个平台，保证所有参与夺宝的用户行为，都享受同样的权利与义务。', 27, 1464120403, 1, '', '', '', 1, 0),
(56, '商品配送', '<p>在您获奖后，一元夺宝会第一时间为您寄出商品，大陆地区免快递费。</p>\n<p>获得商品后，请您尽快提交收货地址，超过7天未确认收货地址，视为自动放弃该商品。</p>\n', 28, 1464120424, 1, '', '', '', 1, 0),
(57, '配送费用', '所有商品大陆地区免费快递。', 28, 1464120563, 1, '', '', '', 1, 0),
(58, '公正保障', '一元夺宝幸运号码计算公式，加入了“老时时彩”数据作为公正数据源，保证开奖结果的随机性，保证绝对公正性。', 27, 1464120629, 1, '', '', '', 1, 0);
